import React from 'react';
import './newRecipe.css';
import { TextField, Button, Rating, IconButton} from '@mui/material';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select, { SelectChangeEvent } from '@mui/material/Select';
// import AddShoppingCartIcon from '@mui/icons-material/AddShoppingCart';
// import { Formik } from 'formik';

function NewRecipe(){
    return (
        <Box
            component="form"
            sx={{
                '& .MuiTextField-root': { m: 1, width: '25ch' },
            }}
            noValidate
            autoComplete="off"
        >
            <div className="mainContainer">
                <div className="centerPane">
                    <div className="formWindow" display="block">
                            <p>New Recipe</p>
                            <hr width="90%"/>
                            <TextField
                                required
                                id="outlined-required"
                                label="Name"
                                defaultValue="recipe name"
                            />
                            <TextField
                                id="outlined-multiline-static"
                                label="Ingredients"
                                multiline
                                rows={4}
                                defaultValue=""
                            />
                            <TextField
                                id="outlined-multiline-static"
                                label="Directions"
                                multiline
                                rows={4}
                                defaultValue=""
                            />
                            <br/><br/>
                            <TextField id="link-to-source" label="Link" variant="outlined" />
                            <TextField id="outlined-basic" label="Prep Time" variant="outlined" />
                            <TextField id="outlined-basic" label="Cook Time" variant="outlined" />
                            <br/><br/>
                            <FormControl sx={{ m: 1, minWidth: 120 }}>
                                <InputLabel id="demo-simple-select-label">Category</InputLabel>
                                <Select
                                    labelId="demo-simple-select-label"
                                    id="demo-simple-select"
                                    value={"age"}
                                    label="Category"
                                    // onChange={handleChange}
                                >
                                    <MenuItem value={"beef"}>Beef</MenuItem>
                                    <MenuItem value={"fish"}>Fish</MenuItem>
                                    <MenuItem value={"pork"}>Pork</MenuItem>
                                    <MenuItem value={"poultry"}>Poultry</MenuItem>
                                    <MenuItem value={"shellfish"}>Shellfish</MenuItem>
                                    <MenuItem value={"desert"}>Desert</MenuItem>
                                    <MenuItem value={"breakfast"}>Breakfast</MenuItem>
                                </Select>
                            </FormControl>
                            <Rating name="no-value" value={null} />
                            {/* <IconButton color="primary" aria-label="add to shopping cart">
                                <AddShoppingCartIcon />
                            </IconButton> */}
                            <br/><br/>
                            <Button variant='contained' color='primary'>CANCEL</Button>
                            <Button variant='contained' color='primary'>DOWNLOAD</Button>
                            <Button variant='contained' color='primary'>SAVE</Button>
                    </div>
                </div>
            </div>
        </Box>
    );
}

export default NewRecipe;
